def array_diff(a, b):
    set_b = set(b)
    return [i for i in a if i not in set_b]

def array_diff(a, b):
    #your code here
    for i in range(len(b)):
        while b[i] in a:
            a.remove(b[i])
    return a

def array_diff(a, b):
    for n in b:
        while(n in a):
            a.remove(n)
    return a

